  const {
    theme,        // 'light' or 'dark'
    setDark,      // set theme to 'dark'
    setLight,     // set theme to 'light'
    toggleTheme,  // toggle theme between 'light' and 'dark'
    variant,      // custom variant on theme
    setVariant    // set the custom variant
  } = useTheme()

